import React from 'react';
import './Round.css';
import HODDIES from '../Assets/hoddie.webp';
import OVERSIZED_SHIRT from '../Assets/oversizeshirt.webp';
import POLO from '../Assets/polo.webp';
import SHIRTS from '../Assets/shirts.webp';
import TSHIRTS from '../Assets/tshirts.webp';

const categories = [
  { name: 'HOODIES', image: HODDIES },
  { name: 'OVERSIZED SHIRT', image: OVERSIZED_SHIRT },
  { name: 'POLO', image: POLO },
  { name: 'SHIRTS', image: SHIRTS },
  { name: 'TSHIRTS', image: TSHIRTS },
];

const Round = () => {
  return (
    <div className="round-categories-container">
      {categories.map((category, index) => (
        <div key={index} className="round-category">
          <div className="round-image">
            <img src={category.image} alt={category.name} />
          </div>
          <div className="round-caption">{category.name}</div>
        </div>
      ))}
    </div>
  );
}

export default Round;
